--
-- Estructura de tabla para la tabla `tcobros_enc`
--

DROP TABLE IF EXISTS `tcobros_enc`;
CREATE TABLE `tcobros_enc` (
  `codiempr` varchar(8) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Codigo de empresa',
  `cobrv_vendedor` varchar(3) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Id de vendedor',
  `cobrv_idcliente` varchar(10) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Id de cliente',
  `cobrv_tipodocu` varchar(2) COLLATE latin1_spanish_ci NOT NULL,
  `cobrv_numero` varchar(10) COLLATE latin1_spanish_ci NOT NULL,
  `cobrd_fechacob` timestamp NULL DEFAULT NULL,
  `cobrd_fechvenc` timestamp NULL DEFAULT NULL,
  `cobrn_monto` double(14,2) DEFAULT NULL,
  `cobrn_abonos` double(14,2) DEFAULT NULL,
  `cobrd_fechfact` timestamp NULL DEFAULT NULL,
  `cobrv_codivend` varchar(6) COLLATE latin1_spanish_ci DEFAULT NULL,
  `cobrv_status` varchar(10) COLLATE latin1_spanish_ci DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;

-- --------------------------------------------------------

--
-- Estructura de tabla para la tabla `tcobros_reg`
--

DROP TABLE IF EXISTS `tcobros_reg`;
CREATE TABLE `tcobros_reg` (
  `codiempr` varchar(8) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Codigo de empresa',
  `cbrov_idcliente` varchar(10) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Id de cliente',
  `cbrov_tipocobr` varchar(2) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Tipo de cobro',
  `cbrod_fecha` timestamp NULL DEFAULT NULL COMMENT 'Fecha de recepcion pago',
  `cbrov_numdoc` varchar(10) COLLATE latin1_spanish_ci NOT NULL COMMENT 'Numero de comprobante de pago',
  `cbrov_idbanco` varchar(6) COLLATE latin1_spanish_ci DEFAULT NULL COMMENT 'Id de banco',
  `cbrod_fecdoc` timestamp NULL DEFAULT NULL COMMENT 'Fecha de comprobante de pago',
  `cbron_monto` double(14,2) DEFAULT NULL COMMENT 'Monto de pago',
  `cbrov_codivend` varchar(6) COLLATE latin1_spanish_ci DEFAULT NULL,
  `cbrov_status` varchar(10) COLLATE latin1_spanish_ci DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;

